CREATE EXTENSION IF NOT EXISTS pgcrypto;

DROP TABLE IF EXISTS avistamentos;

CREATE TABLE avistamentos (
                              id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
                              datahora TIMESTAMPTZ NOT NULL,
                              latitude NUMERIC(9,6) NOT NULL,
                              longitude NUMERIC(9,6) NOT NULL,
                              city VARCHAR(20) NOT NULL,
                              estado CHAR(2) NOT NULL,
                              descricao TEXT,
                              confiabilidade INTEGER,
                              tipo_objeto VARCHAR(20) NOT NULL
);

CREATE INDEX idx_avistamentos_datahora ON avistamentos (datahora);
CREATE INDEX idx_avistamentos_estado ON avistamentos (estado);
CREATE INDEX idx_avistamentos_tipo_objeto ON avistamentos (tipo_objeto);
